def timsort(a: List[Int]): List[Int] = {
  def merge(x: List[Int], y: List[Int]): List[Int] = {
    if (x.isEmpty) y
    else if (y.isEmpty) x
    else {
      val i = x.head - 1
      val j = y.head - 1
      while (i >= 0 && j >= 0 && a(i) <= a(j)) {
        a(i) = a(i) - a(j)
        i = i - 1
        j = j - 1
      }
      a(i) = a(i) - a(j)
      merge(x, y)
    }
  }

  def merge(x: List[Int], y: List[Int], z: List[Int]): List[Int] = {
    if (x.isEmpty) y
    else if (y.isEmpty) z
    else if (z.isEmpty) x
    else {
      val i = x.head - 1
      val j = y.head - 1
      val k = z.head - 1
      while (i >= 0 && j >= 0 && k >= 0 && a(i) <= a(j) && a(j) <= a(k) && a(k) <= a(i)) {
        a(i) = a(i) - a(j)
        i = i - 1
        j = j - 1
        k = k - 1
      }
      a(i) = a(i) - a(j)
      merge(x, y, z)
    }
  }

  val n = a.length
  var i = 0
  while (i < n) {
    var j = i + 1
    while (j < n && a(j) <= a(i)) {
      a(i) = a(i) - a(j)
      i = i + 1
      j = j + 1
    }
    merge(a, a, a(i: j))
    i = j + 1
  }
  a
}
```

